import React, { useEffect, useState } from "react";
import axios from "axios";
import { useLocation, useNavigate } from "react-router-dom";

export default function ProductBuy() {
  const [product_name, setproduct_name] = useState("");
  const [description, setdescription] = useState("");
  const [seller_id, setseller_id] = useState("");
  const [starting_bid, setstarting_bid] = useState("");
  const [deadline, setdeadline] = useState("");

  const location = useLocation();
  const id = location.pathname.split("/")[2]
    ? location.pathname.split("/")[2]
    : "";
  useEffect(() => {
    console.log(id);
    if (id) {
      getproduct();
    }
  }, []);

  const getproduct = async () => {
    const url = "http://localhost:1122/rfa/product/" + id;
    console.log(url);
    const res = await axios.get(url);
    console.log(res.data);
    setproduct_name(res.data.product_name);
    setdescription(res.data.description);
    setseller_id(res.data.seller_id);
    setstarting_bid(res.data.starting_bid);
    setdeadline(res.data.deadline);
  };
  return (
    <div class="main-wrapper" style={{ marginTop: "10px" }}>
      <div class="container">
        <div class="product-div">
          <div class="product-div-left">
            <div class="img-container">
              <img src="images/w1.png" alt="watch" />
            </div>
            {/* <div class="hover-container">
              <div>
                <img src="images/w1.png" />
              </div>
              <div>
                <img src="images/w2.png" />
              </div>
              <div>
                <img src="images/w3.png" />
              </div>
              <div>
                <img src="images/w4.png" />
              </div>
              <div>
                <img src="images/w5.png" />
              </div>
            </div> */}
          </div>
          <div class="product-div-right">
            <span class="product-name">{product_name}</span>
            <span class="product-price">{starting_bid}â‚¹</span>
            <div class="product-rating">
              <span>
                <i class="fas fa-star"></i>
              </span>
              <span>
                <i class="fas fa-star"></i>
              </span>
              <span>
                <i class="fas fa-star"></i>
              </span>
              <span>
                <i class="fas fa-star"></i>
              </span>
              <span>
                <i class="fas fa-star-half-alt"></i>
              </span>
            </div>
            <p class="product-description">{description}</p>
            <div class="container">
              <div class="demo-flex-spacer"></div>

              <div class="webflow-style-input">
                <input
                  class=""
                  type="email"
                  placeholder="What's your email?"
                ></input>
                <button type="submit">
                  <i class="icon ion-android-arrow-forward"></i>
                </button>
              </div>

              <div class="demo-flex-spacer"></div>
              <h1 class="demo">Webflow-style input</h1>
              <a
                class="demo"
                href="https://webflow.com/cms"
                title="Webflow CMS"
              >
                https://webflow.com/cms
              </a>
            </div>
            <div class="btn-groups">
              <button type="button" class="add-cart-btn">
                <i class="fas fa-shopping-cart"></i>Bid now
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
